comments.body:
Thanks [~hagleitn] for the review.
{quote}
DagUtils has methods to retrieve container size and xmx. The patch as is doesn't work if container size isn't set for instance.

It's also not clear to me why these tez settings would be available in the conf object in the map join conversion. I don't think that works.
{quote}
I will use getContainerResource to get the container size. getContainerJavaOpts only contains hive's java opts. I assume in the context of DagUtils I can get the Tez settings properly?

{quote}
There is also a branch missing in adjustMemoryReserveFraction. What happens when the computed value is bigger than the max allowed? Should we set it to max?
{quote}
My previous thought was to return the default fraction if our calculation exceeds the max. But I think returning max in that case makes more sense.
